import React from 'react';
import Head from 'next/head';
import AppLayout from '../components/AppLayout';
const signup = () => {
    return (
        <AppLayout>
        <Head>
            <title>회원가입 | JS</title>
        </Head>
        <AppLayout>회원가입 페이지</AppLayout>
        </AppLayout>
    );
};

export default signup;
